import React from "react";
import "./App.css";
import Navbar from "./Navbar";
import web from "../src/images/myimg.jpg";
import Card from "./Card";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";
import myimg from "../src/images/myimg.jpg";
import { NavLink } from "react-router-dom";
import Sdata from "./Sdata";

function Services() {
  return (
    <>
      <Navbar />
      <div className="container-fluid">
        <div className="row">
          <div className="col-8 mx-auto bg-light">
            <h2 className="text-center" style={{ fontFamily: caveeat }}>
              My Services
            </h2>
            <p className="">
              I design broad variety of designs which your business need to grow
              at resonable prices, I have years of experince with industry and
            </p>
          </div>
        </div>
      </div>
      <div className="container-fluid mb-3">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row gy-4">
              {Sdata.map((v, i) => {
                return <Card key={i} imgsrc={v.img} ctitle={v.title} />;
              })}
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Services;
